import React from 'react';
import './App.css';
import Title from './Component/Title';

function App() {
  return (
    <React.Fragment>
      <div className='Container'>
        <div className='row'>
          <div className='col-sm-5'>
            <Title/>
          </div>
        </div>
      </div>
    </React.Fragment>
  );
}

export default App;
